class Solution:
    # @param {string} s
    # @return {string[]}
    def findRepeatedDnaSequences(self, s):
        if len(s) <= 10:
            return []
        seqs = set()
        result = set()
        for i in range(len(s) - 9):
            key = s[i:i+10]
            if key not in seqs:
                seqs.add(key)
            else:
                result.add(key)
        return list(result)

    def afindRepeatedDnaSequences(self, s):
        if len(s) <= 10:
            return []
        result = []
        for startIdx in range(len(s) - 9):
#            window = s[startIdx:startIdx+10]
            nextStart = startIdx + 1
            while True:
                while s[startIdx] != s[nextStart]:
                    nextStart += 1
                    if nextStart + 10 >= len(s):
                        break
                if s[startIdx] != s[nextStart] or nextStart + 10 >= len(s):
                    break
                match = True
                for i in range(10):
                    if s[startIdx+i] != s[nextStart+i]:
                        match = False
                        break
                if match:
                    result.append(s[startIdx:startIdx+10])
                    break
                nextStart += 1
        return result
                    
        
